import React from "react";

const Hero = () => {
    return (
        <section class="hero">
            <div class="hero-body">
                <div class="container">
                    <h1 class="title">作ってみた。</h1>
                    <h2 class="subtitle">bulma凄い。</h2>
                </div>
            </div>
        </section>
    );
};

const Footer = () => {
    return (
        <footer className = "footer">
            <dvi class = "content has-text-centered">
                <p>&copy; 2020 miura</p>
            </dvi>
        </footer>
    );
}

const App = () => {
    return (
        <div>
            <Hero />
            <Footer />
        </div>
    );
};

export default App;
